Returns collections of all child nodes of current node

[C#]
PresentationEx pres = new PresentationEx("demo.pptx");
SmartArtEx smart = (SmartArtEx)pres.Slides[0].Shapes[0];
SmartArtNodeEx node0 = smart.AllNodes[0];
for ( int i = 0; i < node0.ChildNodes.Count; i++)
{
    SmartArtNodeEx node = node0.ChildNodes[i];
    string outString = string.Format("i = {0}, Text = {1},  Level = {2}, Position = {3}", i, node.TextFrame.Text,
    node.Level, node.Position);
    Console.WriteLine(outString);
}

[Visual Basic]
Dim pres As New PresentationEx("demo.pptx")
Dim smart As SmartArtEx = DirectCast(pres.Slides(0).Shapes(0), SmartArtEx)
Dim node0 As SmartArtNodeEx = smart.AllNodes(0);
Dim i As Integer = 0
While i < node0.ChildNodes.Count
Dim node As SmartArtNodeEx = node0.ChildNodes(i)
Dim outString As String = String.Format("i = {0}, Text = {1},  Level = {2}, Position = {3}", i, node.TextFrame.Text, node.Level, node.Position)
Console.WriteLine(outString)
System.Math.Max(System.Threading.Interlocked.Increment(i),i - 1)
End While

Return or set text of the smartart node.

[C#]
PresentationEx pres = new PresentationEx("demo.pptx");
SmartArtEx smart = (SmartArtEx)pres.Slides[0].Shapes[0];
SmartArtNodeEx node0 = smart.AllNodes[0];
for ( int i = 0; i < node0.ChildNodes.Count; i++)
{
    SmartArtNodeEx node = node0.ChildNodes[i];
    Console.WriteLine(node.TextFrame.Text);
    node.TextFrame.Text = "New text " + i;   
}

[Visual Basic]
Dim pres As New PresentationEx("demo.pptx")
Dim smart As SmartArtEx = DirectCast(pres.Slides(0).Shapes(0), SmartArtEx)
Dim node0 As SmartArtNodeEx = smart.AllNodes(0)
Dim i As Integer = 0
While i < node0.ChildNodes.Count
	Dim node As SmartArtNodeEx = node0.ChildNodes(i)
	Console.WriteLine(node.TextFrame.Text)
	node.TextFrame.Text = "New text " + i
	System.Math.Max(System.Threading.Interlocked.Increment(i),i - 1)
End While

Return or set node as assistant.

[C#]
PresentationEx pres = new PresentationEx();
SlideEx slide = pres.Slides[0];
SmartArtEx smart = slide.Shapes.AddSmartArt(0, 0, 400, 400, SmartArtLayoutTypeEx.Hierarchy);
foreach (SmartArtNodeEx node in smart.AllNodes)
{
      if (node.IsAssistant) node.IsAssistant = false;
}

[Visual Basic]
Dim pres As New PresentationEx()
Dim slide As SlideEx = pres.Slides(0)
Dim smart As SmartArtEx = slide.Shapes.AddSmartArt(0, 0, 400, 400, SmartArtLayoutTypeEx.Hierarchy)
For Each node As SmartArtNodeEx In smart.AllNodes
	If node.IsAssistant Then
	node.IsAssistant = False
	End If
Next

Nesting level of node.

[C#]
PresentationEx pres = new PresentationEx("demo.pptx");
SmartArtEx smart = (SmartArtEx)pres.Slides[0].Shapes[0];
for ( int i = 0; i < smart.AllNodes.Count; i++)
{
   if (smart.AllNodes[i].Level == 2)
   Console.WriteLine(smart.AllNodes[i].Level + " " + smart.AllNodes[i].TextFrame.Text);
}

[Visual Basic]
Dim pres As New PresentationEx("demo.pptx")
Dim smart As SmartArtEx = DirectCast(pres.Slides(0).Shapes(0), SmartArtEx)
Dim i As Integer = 0
While i < smart.AllNodes.Count
If smart.AllNodes(i).Level = 2 Then
Console.WriteLine(smart.AllNodes(i).Level + " " + smart.AllNodes(i).TextFrame.Text)
End If
System.Math.Max(System.Threading.Interlocked.Increment(i),i - 1)
End While

Position of node among sibling nodes.

[C#]
PresentationEx pres = new PresentationEx("demo.pptx");
SmartArtEx smart = (SmartArtEx)pres.Slides[0].Shapes[0];
SmartArtNodeEx node = smart.AllNodes[0];
if (node.ChildNodes.Count > 3)
    node.ChildNodes[0].Position = node.ChildNodes[0].Position + 1;

[Visual Basic]
Dim pres As New PresentationEx("demo.pptx")
Dim smart As SmartArtEx = DirectCast(pres.Slides(0).Shapes(0), SmartArtEx)
Dim node As SmartArtNodeEx = smart.AllNodes(0)
If node.ChildNodes.Count > 3 Then
	node.ChildNodes(0).Position = node.ChildNodes(0).Position + 1
End If

